import styles from '../assets/css/header.module.css';


const linkStyle = {
  marginRight: 15
}

export default function Header(props) {
  return (
    
    <>
      {console.log(props.isDark)}
      <div className={`${props.isDark ? styles.darkbg : styles.lightbg} ${styles.bgc+" grid-container"}`} >

        <img className={styles.image + " text-center"} src='/Chika.png' />

        <div style={{display: 'inline-block'}}>
          <h3>Anime Calendar</h3>
        </div>
      </div>
    
    </>
  )
}
